function SidBar(){
    return(
        <div>
        <ul className="list-unstyled p-3 ">
        <li className="mb-4 "><Link to={"/"}>Get All Prodact</Link></li>
        <li><Link to={"/"}>Get All Categress</Link></li>

        </ul>
        </div>
    )
}
export default SidBar
